//Butons
.button {
  padding: 10px 12px;
  transition: all 250ms;
  cursor: pointer;
  position: relative;
  z-index: 1;
  overflow: hidden;
  font-size: 14px;
  font-weight: 400;

  svg {
    transition: all 200ms;
  }

  &:before {
    width: 0;
    height: 100%;
    position: absolute;
    left: 0;
    top: 0;
    background-color: $blue;
    content: "";
    z-index: -1;
    transition: all 250ms;
  }

  &:focus {
    outline: none;
  }

  &:hover {
    .icon {
      svg {
        stroke: $light;
        fill: $light;
      }
    }

    &:before {
      width: 100%;
