@import "./variables.scss";
@import "./components.scss";

// Serialize
* {
  padding: 0;
  margin: 0;
  list-style: none;
  font-family: $ubuntu;
}

// Ultil's

.bold {
  font-weight: 700;
}

h4 {
  font-weight: 300;
  color: rgba($color: #333, $alpha: 0.5);
  font-size: 18px;
  margin-bottom: 30px;
}

.blue {
  color: $blue !important;
}

.block {
  flex: 1;
  width: 100%;
}

.text-center {
  text-align: center;
}

.text-left {
  text-align: left;
}


// Components

.modal {
  display: flex;
  align-items: flex-start;
  justify-content: center;
  overflow: scroll;
  padding: 50px 0;

  .modal-main {
    top: 50%;
    left: 50%;
    width: 720px;
    background-color: $light;
    margin: 0 auto;
    padding: 30px;
    box-shadow: 0 0 10px rgba($color: #000000, $alpha: 0.2);

    .button-close {
      position: absolute;
      top: 15px;
      right: 15px;
      box-shadow: 0 0 0;
      border: 0;
      border-radius: 100%;
      border: 1px solid #ddd;
      width: 40px;
      height: 40px;
      cursor: pointer;
      transition: all 250ms;

      &:focus {
        outline: none;
      }

      &:hover {
        border-color: $blue;
      }
    }
    form {
      hr {
        margin: 15px 0;
        width: 100%;
        border-color: rgba($color: #000000, $alpha: 0.1);
      }
    }
    .form-group {
      width: 100%;
      margin-bottom: 30px;

      input {
        font-size: 14px;
        width: 100%;
      }

      label {
        z-index: 99;
      }

      .MuiFormControl-root {
        margin: 0;
        display: block;

        .MuiInput-root {
          width: 100%;

          .MuiInput-input {
            // width: 100%;
          }

          .MuiInputAdornment-root {
            position: absolute;
            top: 20px;
            right: 0;
          }

          &:before,
          &:after {
            display: none;
          }
        }
      }
    }

    &:focus {
      outline: none;
    }
  }


  .groupInputs {
    background: #fff;
    padding: 15px 30px 0;
    border: 1px solid #333;
    border-radius: 5px;
    margin-bottom: 30px;
    position: relative;
    overflow: hidden;

    h4 {
      font-size: 18px;
      font-weight: 700;
      text-transform: uppercase;
      margin: 0 0 15px;
      color: #333;
    }

    .button-close {
      border: 0;
      top: -15px;
      right: -35px;
      background: #ff0606;
      text-align: center;
      padding: 25px 0px;
      width: 100px;
      border-radius: 0;
      transform: rotateZ(40deg);
      height: 50px;
      box-sizing: border-box;
    }
  }
}

// Layout
#root {
  background-color: #f2f4f5;
  width: 100%;

  .icon {
    position: relative;
  }

  .header-page {
    margin-bottom: 30px;

    .header-title {
      width: 100%;
      justify-content: flex-start;
      border-bottom: 1px solid rgba($color: #000000, $alpha: 0.08);
      padding: 0 0 15px;
    }

    .header-settings {
      padding: 15px 0;
      width: 100%;
      border-bottom: 1px solid rgba($color: #000000, $alpha: 0.08);

      .button-light {
        margin-right: 15px;
        border: 1px solid transparent;

        svg {
          fill: $blue;
          stroke: $blue;
        }
      }

      .button-primary {
        box-shadow: 0 0 10px rgba($color: #000000, $alpha: 0.08);

        &:hover {
          box-shadow: 0 0 10px rgba($color: #000000, $alpha: 0.1);
        }
      }

      .button {
        &[disabled] {
          box-shadow: 0 0 0;
          background-color: transparent;
          border: 1px solid rgba($color: #000000, $alpha: 0.08);
        }
      }

      .form-group {
        margin-bottom: 0;
        position: relative;

        label {
          position: absolute;
          top: 12px;
          left: 15px;
          pointer-events: none;

          svg {
            fill: $link;
            stroke: $link;
          }
        }

        input,
        select {
          border: 0;
          border: 1px solid #eee;
          background: $light;
          font-size: 14px;
          font-weight: 300;
          padding-left: 35px;
          transition: all 250ms;

          &[disabled] {
            background: #eee;
          }

          &:hover {
            box-shadow: 0 0 10px rgba($color: #000000, $alpha: 0.08);
          }
        }
      }

      .item {
        display: inline-block;
        padding: 10px;
        border-right: 1px solid rgba($color: #000000, $alpha: 0.08);
        font-size: 13px;

        &:last-child {
          border: 0;
        }
      }
    }

    h2 {
      color: $blue;
      font-size: 30px;
      font-weight: 400;
      margin: 0;
    }

    .total {
      margin-left: 30px;
      color: $link;
      font-size: 14px;
    }

    .button {
      .icon {
        margin: 0 !important;
      }
    }
  }

  .dropdown {
    position: relative;
    transition: all 250ms;
    z-index: 9;

    &.active {
      background: $default;
    }

    .dropdown-menu {
      position: absolute;
      flex-direction: column;
      background: $light;
      padding: 0;
      min-width: 190px;
      right: 0;
      margin-top: 25px;
      box-shadow: 0 2px 10px rgba($color: #000000, $alpha: 0.06);
      border: 1px solid #ddd;
      pointer-events: none;
      opacity: 0;
      top: 0;
      transition: all 250ms;

      &.show {
        pointer-events: initial;
        opacity: 1;
        top: 100%;
      }

      &:before {
        top: -6px;
        border-bottom: 6px solid #fff;
        border-right: 6px solid transparent;
        border-left: 6px solid transparent;
        position: absolute;
        left: initial;
        filter: drop-shadow(0 -1px 0.1px #eee);
        right: 12px;
        display: inline-block;
        content: "";
        z-index: 1;
      }

      &:after {
        top: -8px;
        border-bottom: 7px solid #ddd;
        border-right: 7px solid transparent;
        border-left: 7px solid transparent;
        position: absolute;
        left: initial;
        right: 11px;
        display: inline-block;
        content: "";
      }

      a {
        padding: 12px 15px;
        font-size: 14px;
        cursor: pointer;
        text-decoration: none;
        color: $link;

        .icon {
          margin-right: 5px;
          margin-top: -5px;
        }

        &:hover {
          background: #f7f7f7;
        }
      }

      hr {
        margin: 0;
        border: 0;
        border-top: 1px solid rgba($color: #000000, $alpha: 0.1);
      }
    }
  }

  #header {
    background: $light;
    border-bottom: 1px solid rgba($color: #000000, $alpha: 0.1);
