    z-index: 10;

    .avatar {
      text-align: left;
      outline: none;
      background: transparent;
      cursor: pointer;
      padding: 0;
      position: relative;

      img {
        margin-right: 10px;
      }

      .author {
        color: rgba($color: $dark, $alpha: 0.8);
        font-size: 14px;
        margin-bottom: 3px;
      }

      .role {
        color: $link;
        font-size: 11px;
      }
    }

    .dropdown {
      padding: 15px;

      &.active {

        .author,
        .role {
          color: $light;
        }
      }
    }

    .menu {
      position: relative;
      z-index: 1;

      a {
        padding: 20px 15px;
        font-size: 14px;
        cursor: pointer;
        color: $link;
        transition: all 100ms;
        position: relative;
        text-decoration: none;
        z-index: 1;

        .icon {
          position: relative;
          bottom: 2px;
          margin-right: 2px;
        }

        &:after {
          width: 0%;
          height: 1px;
          background: $link;
          content: "";
          left: 50%;
          bottom: -1px;
          position: absolute;
          transition: all 100ms;
        }

        &:hover,
        &.active {
          color: $blue;

          &:after {
            width: 100%;
            left: 0;
            background: $blue;
          }

          .submenu-block {
            left: 0;
            opacity: 1;
            pointer-events: initial;
            visibility: visible;
          }
        }

        .submenu-block {
          position: absolute;
          left: -5px;
          top: 57px;
          background-color: $light;
          min-width: 220px;
          display: flex;
          flex-direction: column;
          transition: all 250ms;
          z-index: 1;
          pointer-events: none;
          opacity: 0;
          visibility: hidden;
          border-radius: 0 0 5px 5px;
          box-shadow: 0px 10px 10px rgba($color: #000000, $alpha: 0.1);

          a {
            padding: 10px 15px;

            &:after {
              display: none;
            }

            &:hover {
              background-color: rgba($color: #333, $alpha: 0.02);
            }
          }
        }
      }

      .overlay-menu {
        width: 100%;
        height: 100%;
        background-color: $light;
        position: absolute;
        left: 0;
        top: 100px;
        opacity: 0;
        transition: all 250ms;
        z-index: -1;
        pointer-events: none;
        visibility: hidden;

        &.active {
          opacity: 1;
          top: 120px;
          visibility: visible;
        }
      }
    }
